class Progetto10:
    def __init__(self, caratteristiche):
        self.Autore = caratteristiche['Autore']
        self.NumRig = caratteristiche['NumRig']
        self.TempoDiEsecuzione= caratteristiche['TempoDiEsecuzione']

    def __repr__(self):
        return f" {self.Autore}   {self.NumRig} {self.TempoDiEsecuzione}\n"

    def confronto(self,TempoDiEsecuzione2):

        if(self.TempoDiEsecuzione<TempoDiEsecuzione2):
            return 0

        elif(self.TempoDiEsecuzione==TempoDiEsecuzione2):
            print("sono veloci uguali")

        else: return 1

